import React from 'react';

const HomeBody = (props) => {
  return (
    <div className="col s12 offset-m2 l6 offset-l3">
      {/* <h1 className="text">sPark App Homepage</h1> */}
      <div className=" grey lighten-5 z-depth-2">
        <div className="row valign-wrapper">
          <img className="background" src={process.env.PUBLIC_URL + 'parking-lot-payment-solution.png'} />
        </div>
      </div>
    </div>
  )
}

export default HomeBody
